import React from "react";
import logo from "./logo.svg";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  Button,
  Card,
  Form,
  Navbar,
} from "react-bootstrap";
import spotifyIcon from "./images/spotify-icon.png";

function App() {
  return (
    <div className="background">
      <div className="App">
        <Navbar className="App-navbar">Kojo Obeng-Arhin</Navbar>
      </div>
      <div>
        <Card id="App-card">
          <Card.Img
            src={require("./images/spotify-youtube.jpg")}
            alt="Spotify-Youtube"
          />
          <a href="http://localhost:8888">
            <Button id="primary-button" class="primary-button">
              Login With Spotify
            </Button>
          </a>
        </Card>
      </div>
      <div></div>
    </div>
  );
}

export default App;
